import React from 'react';
import logo from './logo.svg';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useParams,
  useRouteMatch
} from 'react-router-dom'
import InstagramEmbed from 'react-instagram-embed';
import './App.css';

const catslist = [
  { id: 0, name: 'Pepper', isProtagonist: false, race: 'Chartreux', color: 'Gris' },
  { id: 1, name: 'Aladdin', isProtagonist: false, race: 'Batard', color: 'Roux TigrÃ©' },
  { id: 2, name: 'Mr Mittens', isProtagonist: true, race: 'Batard', color: 'Noir' },
  { id: 4, name: 'Felix', isProtagonist: false, race: 'Siamois', color: 'Beige et Marron' },
];

const instaPosts = [
  { id: 0, url: 'https://instagr.am/p/Zw9o4/' },
  { id: 1, url: 'https://instagr.am/p/Zw8o4/' },
];

class AjaxComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("http://kame.tv/articleJson")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result
          });
          console.log(result)
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      ).catch(console.log)
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return (
        <div className="column is-three-fifths is-offset-one-quarter catbox">
          <div className="cat">
            <div className="cat__body"></div>
            <div className="cat__body"></div>
            <div className="cat__tail"></div>
            <div className="cat__head"></div>
          </div>
        </div>
      );
    } else {
      return (
        <div className="mediaposts">
          {items.map(item => (
            <div className="column is-three-fifths is-offset-one-quarter">
              <div className="box">
                <article className="media">
                  <div className="media-content">
                    <div className="content">
                      <p>
                      <Link to={`article/${item.slug}`}>{cat.name}</Link>
                        <a href=''>
                        <strong className="mediaposts-title">{item.titre}</strong> <small></small>
                        <br />
                          <img src={item.cover} className="mediapostimg" />
                        </a> 
                    </p>
                    </div>
                    <nav className="level is-mobile">
                      <div className="level-left">
                        <a className="level-item" aria-label="reply">
                          <span className="icon is-small">
                            <i className="fas fa-reply" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="retweet">
                          <span className="icon is-small">
                            <i className="fas fa-retweet" aria-hidden="true"></i>
                          </span>
                        </a>
                        <a className="level-item" aria-label="like">
                          <span className="icon is-small">
                            <i className="fas fa-heart" aria-hidden="true"></i>
                          </span>
                        </a>
                      </div>
                    </nav>
                  </div>
                </article>
              </div>
            </div>
          ))}
        </div>



      );
    }
  }
}

function RenderInstaPost(props) {
  const content = props.instaposts.map((post) =>
    <div className="column is-one-quarter">
      <InstagramEmbed
        url={post.url}
        maxWidth={320}
        hideCaption={false}
        containerTagName='div'
        protocol=''
        injectScript
        onLoading={() => { }}
        onSuccess={() => { }}
        onAfterRender={() => { }}
        onFailure={() => { }}
